import React from 'react';
import { BrowserRouter as Router, Link, Route, Routes, Form } from 'react-router-dom';
import Signup from './Signup';
import Login from './Login';
import MealApp from './Meal-App';
import PrivateRoute from './PrivateRoute';

const App = () => {
  return (
    <Router>
      <div className='nav-card'>
        <section  className='nav-text'>
        <h2>Welcome to MealApp</h2>
        <p>Elevate Your Culinary Journey with MealApp</p>
        </section>

        <section className='nav-image'>
          <img src={meal-app-removebg-preview}/>
        </section>
        
        <nav>
          <ul>
            <li className='signup-btn'>
              <Link to="/signup">Sign up</Link>
            </li>
            <li className='login-btn'>
              <Link to="/login">Login</Link>
            </li>
          </ul>
        </nav>
      </div>

      <Routes>
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        {/*<Route path="/meal-app" element={<MealApp />} />*/}
        <Route path="/meal-app" element={<PrivateRoute element={<MealApp />} />} />
        {/* Add more routes for your app as needed */}
      </Routes>
    </Router>
  );
};

export default App;
